import { DDLTable, QQTurn } from '../../src/types';

export type Flight = {
  source: string;
  flightNumbers: string[];
  type: {
    type: string;
  };
  departure: {
    airportCode: string;
    time: string;
  };
  arrival: {
    airportCode: string;
    time: string;
  };
  cabinClass: string;
  numSeatsAvailable?: number;
  stops: {
    airportCode: string;
    layoverMs: number;
  }[];
  segments: {
    flightNumber: string;
    carrier: {
      code: string;
      name: string;
    };
    origin: {
      iata: string;
      municipality: string;
      time: string;
    };
    dest: {
      iata: string;
      municipality: string;
      time: string;
    };
    flightTime: number;
    operatingCarrierName: string;
    baggage?: {
      weight: number | null;
      unit: string | null;
      numPieces: number | null;
    };
  }[];
  price: {
    amount: number;
    currency: string;
  };
  uid: string;
  totalFlightTime: number;
  totalCO2: number;
  fetchedAt: string;
} & {
  bookingClasses?: any;
  fareBasis?: any;
  fareInformation?: any;
  airports?: any;
  co2?: any;
  flightId?: any;
  bookingFlowType?: any;
  id?: any;
  requestId?: any;
  crewLinkFlightSummary?: any;
};

export function stringifyFlight(f: Flight): string {
  return `$${f.price.amount} ${f.price.currency} for ${f.type.type} flight ${
    f.departure.airportCode
  } -> ${f.arrival.airportCode}${
    f.stops && f.stops.length
      ? ` via ${f.stops
          .map(
            (m) =>
              `${m.airportCode} (${Math.floor(
                m.layoverMs / (1000 * 60 * 60),
              )} hours)`,
          )
          .join(', ')}`
      : ''
  }. ${f.numSeatsAvailable} seats in ${f.cabinClass}.${
    f.totalFlightTime ? `Total time ${f.totalFlightTime.toFixed(2)} hours` : ''
  }${f.totalCO2 ? `, CO2 ${f.totalCO2.toFixed(2)} tons` : ''}`;
}

export function flightToRows(flight: Flight): any[][][] {
  return [
    [
      [
        flight.uid,
        flight.source,
        flight.flightNumbers.join(','),
        flight.type.type,
        flight.departure.airportCode,
        flight.departure.time,
        flight.arrival.airportCode,
        flight.arrival.time,
        flight.cabinClass,
        flight.numSeatsAvailable ?? 1,
        flight.totalFlightTime,
        flight.totalCO2,
        flight.fetchedAt,
        flight.price.amount,
        flight.price.currency,
      ],
    ],
    flight.segments.map((s) => [
      flight.uid,
      s.flightNumber,
      s.carrier.code,
      s.carrier.name,
      s.origin.iata,
      s.origin.municipality,
      s.origin.time,
      s.dest.iata,
      s.dest.municipality,
      s.dest.time,
      s.flightTime,
      s.operatingCarrierName,
      s.baggage?.weight ?? null,
      s.baggage?.unit ?? null,
      s.baggage?.numPieces ?? null,
    ]),
    flight.stops.map((s) => [flight.uid, s.airportCode, s.layoverMs]),
  ];
}

export const FLIGHTS_FEW_SHOT_LEARNING: QQTurn[] = [
  {
    question:
      'I need flights arriving between 12 pm and 6, more than 2 hours total time, marine fare ideally, over 12 hours of layover and less than 2 layovers',
    partialQuery: `JOIN (
      SELECT uid, COUNT(orderNumber) - 1 AS numLayovers
      FROM flight_segments
      GROUP BY uid
  ) fs ON Flights.uid = fs.uid
  JOIN (
      SELECT uid, MAX(destTime) - MIN(originTime) AS layoverTime
      FROM flight_segments
      GROUP BY uid
  ) fl ON Flights.uid = fl.uid
  AND fs.numLayovers < 2
  AND fl.layoverTime > 12
  AND Flights.totalFlightHours > 2
  AND strftime('%H:%M', datetime(Flights.arrivalTime, 'unixepoch')) BETWEEN '12:00' AND '18:00'
  ORDER BY CASE WHEN Flights.typeCode = 'Marine' THEN 0 ELSE 1 END, Flights.totalFlightHours ASC;`,
  },
  {
    question:
      'On top of that, anything in Business class from NDC that is a direct flight?',
    partialQuery: `JOIN (
      SELECT uid, COUNT(orderNumber) - 1 AS numLayovers
      FROM flight_segments
      GROUP BY uid
  ) fs ON Flights.uid = fs.uid
  JOIN (
      SELECT uid, MAX(destTime) - MIN(originTime) AS layoverTime
      FROM flight_segments
      GROUP BY uid
  ) fl ON Flights.uid = fl.uid
  AND fs.numLayovers = 0
  AND fl.layoverTime > 12
  AND Flights.totalFlightHours > 2
  AND strftime('%H:%M', datetime(Flights.arrivalTime, 'unixepoch')) BETWEEN '12:00' AND '18:00'
  AND Flights.cabinClass = 'BUSINESS'
  AND Flights.source = 'NDC'
  ORDER BY CASE WHEN Flights.typeCode = 'Marine' THEN 0 ELSE 1 END, Flights.totalFlightHours ASC;`,
  },
  {
    question:
      'Ignore previous filters. Just the cheapest flights in ECONOMY that land at night.',
    partialQuery: `WHERE Flights.cabinClass = 'ECONOMY'
    AND strftime('%H:%M', datetime(Flights.arrivalTime, 'unixepoch')) BETWEEN '18:00' AND '23:59'
    ORDER BY Flights.priceAmount ASC;`,
  },
];

